 3);\r\n                    SLog.WriteLine("l_LastXmlNodeType = XmlNodeType.Comment: " + m_RichTextBox.SelectedText);\r\n                    m_RichTextBox.SelectionColor = this.m_CommentColor;\r\n                    break;\r\n                default:\r\n                    throw new Exception("This has never been seen in parsing: " + l_XmlReader.NodeType);\r\n            }\r\n        }\r\n\r\n        private void ColorSection( int a_iStartPosition, int a_iLength, Color a_Color)\r\n        {\r\n            m_RichTextBox.Select(a_iStartPosition, a_iLength);\r\n            m_RichTextBox.SelectionColor = a_Color;\r\n            SLog.WriteLine("  -> Color Section: " + m_RichTextBox.SelectedText);\r\n        }\r\n\r\n        private bool ColorAttribute(int l_LastPosition, bool l_bHadAttributes)\r\n        {\r\n            if (l_bHadAttributes)\r\n            {\r\n                string l_text = m_RichTextBox.SelectedText;\r\n                using (Tokenizer l_Tokenizer = new Tokenizer(l_text))\r\n                {\r\n                    string l_ElementName = l_Tokenizer.Identifier();\r\n                    ColorSection(l_LastPosition + l_Tokenizer.Position - l_ElementName.Length\r\n                                , l_ElementName.Length\r\n                                , this.m_ElementNameFontColor);\r\n                    \r\n                    string l_sw = l_Tokenizer.WhiteSpace();\r\n\r\n                    string l_AttributeName = l_Tokenizer.Identifier();\r\n                    while (l_AttributeName.Length > 0)\r\n                    {\r\n                        ColorSection(l_LastPosition + l_Tokenizer.Position - l_AttributeName.Length\r\n                                    , l_AttributeName.Length\r\n                                    , this.m_AttributeNameColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.White;\r\n\r\n                        l_Tokenizer.WhiteSpace();\r\n\r\n                        l_Tokenizer.ValidateCharacter(''='');\r\n                        ColorSection( l_LastPosition + l_Tokenizer.Position - 1, 1, this.m_EqualsColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightBlue;\r\n\r\n                        l_Tokenizer.WhiteSpace();\r\n\r\n                        l_Tokenizer.ValidateCharacter(''"'');\r\n                        ColorSection( l_LastPosition + l_Tokenizer.Position - 1, 1, this.m_QuoteColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n\r\n                        string l_AttributeValue = l_Tokenizer.ReadUntil(''"'');\r\n                        ColorSection(l_LastPosition + l_Tokenizer.Position - l_AttributeValue.Length, l_AttributeValue.Length, m_AttributeValueColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.White;\r\n\r\n                        l_Tokenizer.ValidateCharacter(''"'');\r\n                        ColorSection(l_LastPosition + l_Tokenizer.Position - 1, 1, this.m_QuoteColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n\r\n                        string l_ws = l_Tokenizer.WhiteSpace();\r\n\r\n                        l_AttributeName = l_Tokenizer.Identifier();\r\n                    }\r\n                }\r\n                return true;\r\n            }\r\n            return false;\r\n        }\r\n    }\r\n}\r\n//using System;\r\n//using System.Collections.Generic;\r\n//using System.Text;\r\n//using System.Windows.Forms;\r\n//using System.Xml;\r\n//using Utilities;\r\n//using System.IO;\r\n//using System.Drawing;\r\n\r\n//namespace Utilities\r\n//{\r\n//    public class XmlRichTextBoxSyntaxHighlighting : SaxParser\r\n//    {\r\n//        private RichTextBox m_RichTextBox;\r\n\r\n//        private Font m_RegularFont;\r\n//        private Font m_BoldFont;\r\n\r\n//        private Color m_BracketFontColor        = Color.DarkRed;\r\n//        private Color m_ElementNameFontColor    = Color.Green;\r\n//        private Co