INSERT INTO pdat_pers_notes (pdat_pers_notes_id, note_text, pdat_person_id, create_date, create_user, modify_date, modify_user, active_flag) VALUES
  ('2', 'Last I had heard had beat cancer.', '98', '2006-02-27 01:02:18.852632+00', 'DENGLISH', '2006-02-27 01:02:18.852632+00', 'DENGLISH', 'Y'),
  ('4', 'Called because his daughter had a math problem.  It turned out to be a quadratic equation.', '106', '2006-02-27 01:04:35.996572+00', 'DENGLISH', '2006-02-27 01:04:35.996572+00', 'DENGLISH', 'Y'),
  ('10', 'I called him on 9/26/2006, and he said he wanted me to get together with him next week.  He gave me the address to his facility which I also entered into this system.', '223', '2006-09-26 15:54:44.351432+00', 'DENGLISH_BUSINESS', '2006-09-26 15:54:44.351432+00', 'DENGLISH_BUSINESS', 'Y'),
  ('11', 'I have an appointment with her next tuesday at 1:30 pm to go over here advertising campaign proposition.', '225', '2006-09-26 16:35:27.149175+00', 'DENGLISH_BUSINESS', '2006-09-26 16:35:27.149175+00', 'DENGLISH_BUSINESS', 'Y'),
  ('12', 'I am the founder of webcentric data services.', '43', '2006-09-26 19:12:13.646077+00', 'DENGLISH', '2006-09-26 19:20:47.998957+00', 'DENGLISH', 'Y'),
  ('13', 'This is the person with whom I deal with when I opend up my 30K line of credit with Chase Manhatten.  We close on 9/11/2006 at 4:00 pm.', '226', '2006-09-26 20:16:43.88801+00', 'DENGLISH_BUSINESS', '2006-09-26 20:17:40.176376+00', 'DENGLISH_BUSINESS', 'Y'),
  ('14', 'I Talked to Christina today.  She gave me the logn name has password for their website.\r\n\r\n1: Go to http://www.bizland.com/bizland\r\n2: Click on "MEMBERS AREA"\r\n3: logon with rstglobal/global\r\n', '1219247', '2006-10-18 21:08:18.470843+00', 'DENGLISH_BUSINESS', '2006-10-18 21:10:37.92148+00', 'DENGLISH_BUSINESS', 'Y'),
  ('15', 'Dean has the logo stuff.', '1219248', '2006-10-18 21:12:24.585588+00', 'DENGLISH_BUSINESS', '2006-10-18 21:12:24.585588+00', 'DENGLISH_BUSINESS', 'Y'),
  ('16', 'This tester guy is a really good guy!', '1219255', '2006-11-16 22:54:19.580729+00', 'JDOE', '2006-11-16 22:54:19.580729+00', 'JDOE', 'Y'),
  ('17', 'Everthing this guy does turns to gold.  He is really amazing.', '205', '2006-11-16 23:00:35.607829+00', 'JDOE', '2006-11-16 23:00:35.607829+00', 'JDOE', 'Y'),
  ('18', 'hi', '205', '2007-05-18 20:06:40.031889+00', 'JDOE', '2007-05-18 20:06:40.031889+00', 'JDOE', 'N'),
  ('19', 'I have finished the cleanup of the "Personal Data system"', '43', '2007-07-15 22:59:48.457624+00', 'DENGLISH', '2007-07-15 22:59:48.457624+00', 'DENGLISH', 'Y'),
  ('20', 'I need to enter in the IP for the Rackspace server.', '1221276', '2008-10-09 14:58:09.901708+00', 'DENGLISH', '2008-10-09 14:58:09.901708+00', 'DENGLISH', 'Y'),
  ('21', 'This is a note', '1219381', '2008-11-18 21:25:46.567155+00', 'JDOE', '2008-11-18 21:25:46.567155+00', 'JDOE', 'Y'),
  ('22', 'T-SQL Query to get a list of all tables with foreign key reference to you.\r\n\r\nselect OBJECT_NAME(fkeyid)\r\nfrom sysforeignkeys\r\nwhere OBJECT_NAME(rkeyid) = ''Locations''\r\norder by OBJECT_NAME(fkeyid)', '1221283', '2009-11-30 23:03:28.834234+00', 'DENGLISH', '2009-11-30 23:03:28.834234+00', 'DENGLISH', 'Y');
